import React from 'react';
import Carrocel from '../../components/Carrocel';
import SectionSlider from '../../components/Slider';

import { Container, CaroucelSection } from './styles';

import Slider from "react-slick";


export function Home() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return(
    <Container>
      <SectionSlider />

      <CaroucelSection>
        <Slider {...settings}>
          <Carrocel />
          <Carrocel />
          <Carrocel />
          <Carrocel />
          <Carrocel />

        </Slider>
      </CaroucelSection>

    </Container>
  );
};
